import { Data, FoodData, Discounts, Items, initialState } from '../Reducers/cartReducer';

export default function Food(props: object) {
  const SORTED_FOODS = props.list;

  return(
    <>
    <div>
      {SORTED_FOODS.map(([key,foods]:[string, Items]) :ReactElement => {
        return (
          <div key={key}>
            {foods.map((food:Items): ReactElement => {
              return <div key={food}>{food.name}</div>
            })}
          </div>
        ); 
      })}
    </div>
    </>
  )
}
